import React from "react";
import Header from "./Header";
import SearchBar from "./SearchBar";
import "./App.css";

function MovieCategories() {
  return (
    <ul className="category-list">
      <li className="category-item">公開予定の映画</li>
      <li className="category-item">上映中の映画</li>
      <li className="category-item">話題の映画</li>
      <li className="category-item">評価の高い映画</li>
    </ul>
  );
}

function App() {
  return (
    <div className="container">
      <Header />
      <SearchBar />
      <MovieCategories />
    </div>
  );
}

export default App;
